    tableDataTwo: 'http://20181024Mock.com/mode1/tableDataTwo',
    tableDataThi: 'http://20181024Mock.com/mode1/tableDataThi',
}
Mock.mock(url.index, {data: {
    'result|5': [{
        'id|+1': 1,
        'productImg': Mock.Random.image('180x200'),
        'productDes|1': ['九成新哦，先到先得','貂皮大衣','八成新','这个东西好好看的'],
        'productPrice|18-280': 20
    }]
}});
Mock.mock(url.type, {data: {
    'result|10': [{
        'id|+1': 1,
        'name|1': ['数码','服装','居家','美妆','家电','玩具','运动'],
    }]
}})
